00;\r\n    }\r\n    .mail-body__header-description{\r\n        color: #969696;\r\n        font-size: 16px;\r\n    }\r\n    .mail-body__link{\r\n        margin-top: 30px;\r\n        width: 100%;\r\n    }\r\n    .mail-body__link td{\r\n        text-align: center;\r\n        padding-bottom: 5px;\r\n    }\r\n    .mail-body__link tr:last-child td{\r\n        padding-bottom: 0px;\r\n    }\r\n\r\n    .mail-admin__button{\r\n        display: inline-block;\r\n        max-width: 350px;\r\n        width: 100%;\r\n        font-size: 18px;\r\n        background: #5867dd;\r\n        box-shadow: 0 5px 10px 2px rgba(88,103,221,0.19);\r\n        -webkit-box-shadow: 0 5px 10px 2px rgba(88,103,221,0.19);\r\n        -moz-box-shadow: 0 5px 10px 2px rgba(88,103,221,0.19);\r\n        color: #fff;\r\n        padding: 17px 30px;\r\n        text-align: center;\r\n        text-decoration: none;\r\n        border-radius: 5px;\r\n        -webkit-border-radius: 5px;\r\n        -moz-border-radius: 5px;\r\n    }\r\n    .mail-block__admin-header{\r\n        height: 60px;\r\n        line-height: 60px;\r\n        background: #262734;\r\n        -webkit-box-shadow: 0 1px 15px 1px rgba(113,106,202,0.5);\r\n        -moz-box-shadow: 0 1px 15px 1px rgba(113,106,202,0.5);\r\n        box-shadow: 0 1px 15px 1px rgba(113,106,202,0.5);\r\n        padding: 0px 15px;\r\n        color: #fff;\r\n        font-size: 16px;\r\n    }\r\n    .mail-block__admin-header a{\r\n        color: #fff;\r\n        text-decoration: none;\r\n    }\r\n\r\n    /* Media */\r\n    @media only screen and (max-width: 768px) {\r\n        .mail-container{\r\n            min-width: 100%;\r\n        }\r\n        .mail-admin__button{\r\n            width: auto;\r\n            display: block;\r\n            margin: 0 auto;\r\n        }\r\n        .mail-body{\r\n            margin-top: 5px;\r\n        }\r\n        .mail-block{\r\n            margin: 0px auto;\r\n        }\r\n    }\r\n</style>\r\n</body>\r\n</html>', 1544605778, 1543837600);
INSERT INTO `notification_templates` (`id`, `notification_code`, `status`, `subject`, `body`, `created_at`, `updated_at`) VALUES
(6, 'order_completed', 1, 'Order #{{ order.id }} completed', '<!doctype html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width\">\r\n</head>\r\n<body>\r\n\r\n<table class=\"mail-block\">\r\n    <tbody>\r\n        <tr>\r\n            <td class=\"mail-block__body\">\r\n                <table class=\"mail-header\">\r\n                    <tbody>\r\n                    <tr>\r\n                        <td>\r\n                            <table class=\"mail-container mail-header__top\">\r\n                                <tbody>\r\n                                <tr>\r\n                                    <td>\r\n                                        {% if site.logo %}\r\n                                            <img src=\"{{ site.logo }}\" alt=\"\" class=\"img-responsive\">\r\n                                        {% else %}\r\n                                            <h2 class=\"mail-header__title\">{{ site.store_name }}</h2>\r\n                                        {% endif %}\r\n                                    </td>\r\n                                    <td class=\"text-right mail-header__top-order\">\r\n                                        Order #{{ order.id }}\r\n                                    </td>\r\n                                </tr>\r\n                                </tbody>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                    </tbody>\r\n                </table>\r\n                <table class=\"mail-container mail-body\">\r\n                    <tbody>\r\n                    <tr>\r\n                        <td>\r\n                            <table class=\"mail-body__header text-center\">\r\n                                <tbody>\r\n                                <tr>\r\n                                    <td>\r\n                                        <span class=\"mail-body__header-title\">\r\n                                            Order #{{ order.id }} completed\r\n                                        </span>\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td>\r\n                                        <span class=\"mail-body__header-description\">\r\n                                            <!-- Description Start-->\r\n\r\n                                            <!-- Description End-->\r\n                                        </span>\r\n                                    </td>\r\n                                </tr>\r\n                                </tbody>\r\n                            </table>\r\n                            <table class=\"mail-body__link\">\r\n                                <tbody>\r\n                                <tr>\r\n                                    <td>\r\n                                        <a href=\"{{ order.url }}\" class=\"mail-visit-button\">View your order</a>\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td>\r\n                                        or\r\n                                    </td>\r\n                                </tr>\r\n                                <tr>\r\n                                    <td>\r\n                                        <a href=\"{{ site.url }}\" class=\"mail-visit-button-store\">Visit our store</a>\r\n                                    </td>\r\n                                </tr>\r\n                                </tbody>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                    </tbody>\r\n                </table>\r\n                <table class=\"mail-footer\">\r\n                    <tbody>\r\n                    <tr>\r\n                        <td>\r\n                            <table class=\"mail-container mail-footer__body\">\r\n                                <tbody>\r\n                                <tr>\r\n                                    <td class=\"text-center\">\r\n                                        If you have any questions contact us at <a href=\"mailto:{{ site.admin_email }}\">{{ site.admin_email }}</a>\r\n                                    </td>\r\n                                </tr>\r\n                                </tbody>\r\n                            </table>\r\n                        </td>\r\n                    </tr>\r\n                    </tbody>\r\n                </table>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<style>\r\n    .html, body{\r\n        padding: 15px;\r\n        margin: 0px;\r\n        font-family: Arial, Helvetica, sans-serif;\r\n        font-size: 14px;\r\n        color: #4e4848;\r\n        background: #f7f7f7;\r\n    }\r\n    table{\r\n        border-spacing: 0;\r\n        border-collapse: collapse;\r\n    }\r\n    .mail-block{\r\n        background: #fff;\r\n        margin: 30px auto;\r\n        max-width: 700px;\r\n        box-shadow: 0px 1px 4px 0px #e6e6e6;\r\n        -webkit-box-shadow: 0px 1px 4px 0px #e6e6e6;\r\n        -moz-box-shadow: 0px 1px 4px 0px #e6e6e6;\r\n    }\r\n    .mail-block__body{\r\n        padding: 0px 30px;\r\n    }\r\n    .mail-container{\r\n        max-width: 768px;\r\n        min-width: 650px;\r\n        width: 100%;\r\n        margin: 0 auto;\r\n        padding: 0px 15px;\r\n    }\r\n    .text-right{\r\n        text-align: right;\r\n    }\r\n    .text-center{\r\n        text-align: center;\r\n    }\r\n    .mail-header{\r\n        height: 120px;\r\n        width: 100%;\r\n    }\r\n    .mail-footer{\r\n        height: 75px;\r\n        width: 100%;\r\n        font-size: 14px;\r\n        margin-top: 70px;\r\n    }\r\n    .mail-footer a{\r\n        color: #333;\r\n    }\r\n    .mail-body{\r\n        width: 100%;\r\n        margin-top: 30px;\r\n        margin-bottom: 30px;\r\n    }\r\n    .mail-footer__body{\r\n        max-width: 768px;\r\n        width: 100%;\r\n        margin: 0 auto;\r\n    }\r\n    .img-responsive{\r\n        display: block;\r\n        width: auto;\r\n        height: auto;\r\n    }\r\n    .mail-header__top{\r\n\r\n    }\r\n    .mail-header__top-order{\r\n        font-size: 18px;\r\n        color: #a9a9a9;\r\n    }\r\n    .mail-header__top img{\r\n        max-width: 250px;\r\n        display: inline-block;\r\n    }\r\n    .mail-body__content{\r\n        width: 100%;\r\n        border: 1px solid #ddd;\r\n        border-radius: 5px;\r\n    }\r\n    .mail-body__content td{\r\n        padding: 10px 10px;\r\n        border-bottom: 1px solid #ddd;\r\n        border-right: 1px solid #ddd;\r\n    }\r\n    .order-total{\r\n        font-weight: bold;\r\n    }\r\n    .order-total__title{\r\n        text-align: right;\r\n    }\r\n    .order-total__price{\r\n        font-size: 20px;\r\n        font-weight: bold;\r\n    }\r\n    .order-total-all{\r\n        font-size: 20px;\r\n        font-weight: bold;\r\n    }\r\n    .mail-body__caption{\r\n        font-size: 22px;\r\n        width: 100%;\r\n    }\r\n    .mail-body__caption{\r\n        border-top: 1px solid #ddd;\r\n        border-left: 1px solid #ddd;\r\n        border-right: 1px solid #ddd;\r\n    }\r\n    .mail-body__caption td{\r\n        padding: 10px;\r\n    }\r\n    .mail-body__header{\r\n        margin: 15px auto;\r\n        width: 100%;\r\n    }\r\n    .mail-body__header-title{\r\n        font-size: 28px;\r\n        font-weight: 600;\r\n    }\r\n    .mail-body__header-description{\r\n        display: block;\r\n        width: 100%;\r\n        color: #867979;\r\n        line-height: 1.5;\r\n    }\r\n    .mail-body__payment{\r\n        margin-top: 15px;\r\n        font-size: 18px;\r\n    }\r\n    .mail-body__payment-title{\r\n        font-weight: bold;\r\n    }\r\n    .mail-visit-button{\r\n        display: inline-block;\r\n        max-width: 350px;\r\n        width: 100%;\r\n        font-size: 18px;\r\n        background: #00A3E3;\r\n        color: #fff;\r\n        padding: 17px 30px;\r\n        text-align: center;\r\n        text-decoration: none;\r\n        border-radius: 5px;\r\n        -webkit-border-radius: 5px;\r\n        -moz-border-radius: 5px;\r\n    }\r\n    .mail-visit-button-store{\r\n        color: #4e4848;\r\n    }\r\n    .mail-body__link{\r\n        margin-top: 30px;\r\n        width: 100%;\r\n    }\r\n    .mail-body__link td{\r\n        text-align: center;\r\n        padding-bottom: 5px;\r\n    }\r\n    .mail-body__link tr:last-child td{\r\n        padding-bottom: 0px;\r\n    }\r\n\r\n    @media only screen and (max-width: 768px) {\r\n        .mail-container{\r\n            min-width: 100%;\r\n        }\r\n        .mail-visit-button{\r\n            width: auto;\r\n            display: block;\r\n            margin: 0 auto;\r\n        }\r\n        .mail-header__top{\r\n            text-align: center;\r\n        }\r\n        .mail-body{\r\n            margin-top: 5px;\r\n        }\r\n        .mail-body__caption{\r\n            font-size: 20px;\r\n        }\r\n        .mail-block{\r\n            margin: 0px auto;\r\n        }\r\n        .mail-header__top img{\r\n            max-width: 200px;\r\n        }\r\n    }\r\n</style>\r\n</body>\r\n</html>', 1544604024, 1544603910),
