il-body__header{\r\n        margin: 15px auto;\r\n        text-align: left;\r\n        width: 100%;\r\n    }\r\n    .mail-body__header-title{\r\n        font-size: 28px;\r\n        font-weight: 600;\r\n    }\r\n    .mail-body__header-description{\r\n        color: #4e4848;\r\n        font-size: 18px;\r\n    }\r\n    .mail-body__link{\r\n        margin-top: 30px;\r\n        width: 100%;\r\n    }\r\n    .mail-body__link td{\r\n        text-align: center;\r\n        padding-bottom: 5px;\r\n    }\r\n    .mail-body__link tr:last-child td{\r\n        padding-bottom: 0px;\r\n    }\r\n\r\n    .mail-admin__button{\r\n        display: inline-block;\r\n        max-width: 350px;\r\n        width: 100%;\r\n        font-size: 18px;\r\n        background: #5867dd;\r\n        box-shadow: 0 5px 10px 2px rgba(88,103,221,0.19);\r\n        -webkit-box-shadow: 0 5px 10px 2px rgba(88,103,221,0.19);\r\n        -moz-box-shadow: 0 5px 10px 2px rgba(88,103,221,0.19);\r\n        color: #fff;\r\n        padding: 17px 30px;\r\n        text-align: center;\r\n        text-decoration: none;\r\n        border-radius: 5px;\r\n        -webkit-border-radius: 5px;\r\n        -moz-border-radius: 5px;\r\n    }\r\n    .mail-block__admin-header{\r\n        height: 60px;\r\n        line-height: 60px;\r\n        background: #262734;\r\n        -webkit-box-shadow: 0 1px 15px 1px rgba(113,106,202,0.5);\r\n        -moz-box-shadow: 0 1px 15px 1px rgba(113,106,202,0.5);\r\n        box-shadow: 0 1px 15px 1px rgba(113,106,202,0.5);\r\n        padding: 0px 15px;\r\n        color: #fff;\r\n        font-size: 16px;\r\n    }\r\n    .mail-block__admin-header a{\r\n        color: #fff;\r\n        text-decoration: none;\r\n    }\r\n\r\n    /* Media */\r\n    @media only screen and (max-width: 768px) {\r\n        .mail-container{\r\n            min-width: 100%;\r\n        }\r\n        .mail-admin__button{\r\n            width: auto;\r\n            display: block;\r\n            margin: 0 auto;\r\n        }\r\n        .mail-body{\r\n            margin-top: 5px;\r\n        }\r\n        .mail-block{\r\n            margin: 0px auto;\r\n        }\r\n    }\r\n</style>\r\n</body>\r\n</html>', 1544605779, 1544605714);
